public class MoonReaver : QuestClass
{
	public MoonReaver()
	{
		Name = "Moon Reaver";
		QuestId.Add(42751);
		Step.AddRange(new[] { 1, 1, 0, 0, 0 });
	}
	public override bool Pulse()
	{
		var p = new Vector3(1910.14, 6293.818, -29.90142, "None");
		if (ObjectManager.Me.IsOutdoors)
		{
			var entrance = new Vector3(1839.08, 6249.516, 0.701319, "None");
			if (GoToTask.ToPosition(entrance))
			{
				if (Questing.Gather(entrance, 251300))
				{
					//do nothing
				}
				GoToTask.ToPosition(p);
			}
			return true;
		}
		GoToTask.ToPosition(p);
		if (!Questing.ObjectiveComplete(this, 1))
		{
			return Questing.Attack(108641);
		}
		else
		{
			GoToTask.ToPositionAndIntecractWithNpc(p, 108642, 1);
		}
		return true;
	}
}

