public class GrassrootsEffort : QuestClass
{
	List<Vector3> _hotspots = new List<Vector3>() {
		new Vector3(2304.562, 5884.193, 163.5572, "None"),
		new Vector3(2295.682, 5825.269, 166.4523, "None"),
		new Vector3(2264.946, 5823.2, 158.5849, "None"),
		new Vector3(2252.783, 5822.047, 158.6091, "None"),
		new Vector3(2232.155, 5847.571, 160.2781, "None"),
	};
	List<int> _bramblesID = new List<int>() {
		109182,
		251434,
	};
	uint itemID = 138815;
	public GrassrootsEffort()
	{
		Name = "Grassroots Effort";
		QuestId.Add(42884);
		Step.AddRange(new[] { 5, 0, 0, 0, 0 });
	}
	public override bool IsComplete()
	{
		return Questing.ObjectiveComplete(this, 1);
	}
	public override bool Pulse()
	{
		var brambles = ObjectManager.GetWoWGameObjectByEntry(_bramblesID);
		foreach (var bramble in brambles)
		{
			foreach (var p in _hotspots)
			{
				if (p.DistanceTo(bramble.Position) < 7)
				{
					if (GoToTask.ToPosition(p))
					{
						MountTask.DismountMount();
						ItemsManager.UseItem(itemID);
						wManager.wManagerSetting.AddBlackList(bramble.Guid, 3 * 60 * 1000, true);
						Usefuls.WaitIsCasting();
						Thread.Sleep(Others.Random(500, 1000));
					}
				}
			}
		}
		GoToTask.ToPosition(_hotspots[Others.Random(0, _hotspots.Count - 1)]);
		return true;
	}
}
